(21, 'MFDO', '메프도', '추가 부여 기능 안내입니다.', '<p style=\"text-align: center; \"><span style=\"font-size: 22px; color: rgb(77, 169, 255);\"><b style=\"\">추가부여기능</b></span></p><p style=\"text-align: center; \"><span style=\"font-size: 22px; color: rgb(77, 169, 255);\"><b style=\"\"><br></b></span></p><p style=\"text-align: center; \"><span style=\"font-size: 22px;\"><b><br></b></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">1. 삭제시 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">포인트 회수</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">하기\r\n</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">2. 포인트 세션 등록을 통해 header에 표기되는 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">포인트 즉시 변경\r\n</span></b></span></p><p><span style=\"display: inline !important;\"><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></b></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">3. </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">메인 화면</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">에서 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">최근 게시글 클릭</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">을 통해 접근 가능\r\n</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">4. 로그인 계정과 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">글 작성자가 동일하거나 관리자만 수정/삭제</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">가능</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">5. </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">강의 정주행 컨텐츠</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"> 생성</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">6. 내 정보에서 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">나의 정보, 내가 쓴 글, 송/수신 쪽지를 동시 확인&nbsp;</span></b></span><span style=\"font-size: 18px; display: inline !important;\">가능하게 하였음</span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">7. 게시글 제목이 특정 글자수를 넘게 되면 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">말 줄임표(...) 표기</span></b></span></p><p><span style=\"display: inline !important;\"><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></b></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">8. </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">게시판 글 작성시 이쁘게</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"> 됨</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">9. 게시판에 </span><b style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">이미지 등록시 그대로 출력</span></b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">됨</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">10. 회원가입 및 로그인&nbsp;</span><span style=\"color: rgb(156, 198, 239);\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"> </span><b><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">폼 예쁘게 변경</span></b></span><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">&gt;&lt;</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">11. <span style=\"font-weight: bold; color: rgb(156, 198, 239);\">교수님 갤러리</span> 생성~! 유후우우 예쁜 사진이 가득!</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">12. 띄용띄용~ <span style=\"color: rgb(156, 198, 239); font-weight: bold;\">헤더 항목 애니메이션 </span>추가</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">13. <span style=\"color: rgb(156, 198, 239); font-weight: bold;\">관리자</span> 모드 설정을 통한 <span style=\"font-weight: bold; color: rgb(156, 198, 239);\">공지사항 설정</span> 기능</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">14. <b style=\"color: rgb(156, 198, 239);\">공지사항 표시 바</b> 제작</span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><br></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">15. 어드민이 아닐 시 <b style=\"color: rgb(156, 198, 239);\">admin.php 접근 불가</b></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><b style=\"color: rgb(156, 198, 239);\"><br></b></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\">16. 읽지않은<b style=\"color: rgb(156, 198, 239);\"> 쪽지 알림</b></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><b style=\"color: rgb(156, 198, 239);\"><br></b></span></span></p><p><span style=\"display: inline !important;\"><span style=\"font-size: 18px; font-family: \" 맑은=\"\" 고딕\";\"=\"\"><span style=\"display: inline !important;\">17. <span style=\"color: rgb(156, 198, 239); font-weight: bold;\">쪽지를 읽지 않았다</span>면 제목 좌측에 <b style=\"color: rgb(156, 198, 239);\">[New] 표기</b></span><b style=\"color: rgb(156, 198, 239);\"><br></b></span></span></p>', '2020-12-17 (15:00)', 80, '', '', '', 1),
