(23, 'ChaCha', '차차', '교수님 성지순례 오셨다', '신난다~~~ 유후우우우우\r\n존경합니다 교수님~!~!~!~!', '2020-12-23 (06:14)', 2, '', '', '', 1),
(24, 'mingyu', '정민큐', '교수님을 향한 내 마음이란', '대학원을 다니면서까지 계속 보고싶을 정도랄까...?\r\n오묘한 이 마음... 싱숭생숭한 하루이다...★', '2020-12-23 (06:16)', 7, '', '', '', 1),
(25, 'ChaCha', '차차', '교수님 아이폰 앱 개발 제가 전적으로 맡겠습니다!', '제가 또 애플 사랑하지 않습니까?\r\n아이폰 개발 너무 하고싶었어요!\r\n이번 기회가 생겨서 너무 신이 나네요!\r\n그러니 이번 연구과제 앱개발. 제가 전적으로 맡겠습니다.', '2020-12-23 (18:27)', 3, '', '', '', 1),
(26, 'ChaCha', '차차', '아아 출근하기 싫다', '아아아아 자야하는데\r\n아아아아아아아 7시에 일어나야 하는데\r\n아아아아아 잠은 안오고\r\n아아아아 어쩜좋담.', '2020-12-23 (18:28)', 3, '', '', '', 1),
(27, 'IUlover', '유정요정', '좋은 아침이에요!', '오늘 같은 날에는 즐거운 웹프로그래밍을 해야죠!\r\n하하하하&gt;&lt;\r\n누가봐도 유정이는 아니네요 아쉽당...', '2020-12-23 (18:29)', 2, '', '', '', 1),
(28, 'IUlover', '유정요정', '[오늘의 주접] 솔직히 우리학과 교수님중 이현섭 교수님이 최고지 않아?', '다른 교수님들이 나쁘단건 아닌데\r\n유독 이현섭교수님이 친근감도 있고 과제도 좀 재미있게 내시잖어!\r\n그리고 시험도 부담없는데다가 학점도 잘 주시니까!\r\n그래서 나는 이현섭교수님이 최고라고 생각해!', '2020-12-23 (18:31)', 3, '', '', '', 1),
(29, 'MFDO', '메프도', '오늘도 정말 뿌듯한 하루였어', '어제는 교수님 이미지를 7장을 만들었는데\r\n오늘은 한장을 만들었어!\r\n그런데 오늘건 정말 예쁜거야! 그래서 팬페이지 메인으로 해봤어!\r\n이전 이미지가 아깝긴하지만 예쁘기 위해서는 이정도는 감수해야한다고!', '2020-12-23 (18:33)', 3, 'main_img.png', 'image/png', '2020_12_23_18_33_29.png', 1),
(30, 'SUBSTAR', '이현섭', '여러분의 성원에 몸둘바를 모르겠네요..;;', '이번학기 많은 우여곡절이 있었지만,\r\n그래도 잘 따라와준 열정적인 학생이 있었기에 좋은 결과가 있었던 거 같네요.\r\n아니 그런데 이런걸 만들 생각 누가 했냐?', '2020-12-23 (18:35)', 6, '', '', '', 1),
(31, 'SUBSTAR', '이현섭', '결정했습니다.', '중간고사는 어 살짝 너무했는데;;\r\n그래도 기말은 열심히 했네\r\n약간 애매하지만 그래도 뭐 A는 줄게\r\n(교수님 희망사항일 뿐 입니다. 존경합니다 사랑합니다 교수님)', '2020-12-23 (18:37)', 3, '', '', '', 1),
(32, 'MFDO', '메프도', '즐거운 하루입니다!', '자기 전에 머리가 너무 아파서 걱정을 했었는데\r\n일어나니 더 아프네요!\r\n다들 건강한 크리스마스 이브 보내기를...*', '2020-12-24 (02:17)', 4, '', '', '', 1),
(33, 'redHyeonSu', '정현수', '에...', '웹프 막상 해보니까 어렵진 않네\r\n구성하기 좀 힘든 것 빼면..\r\n다들 이 정도는 그냥 하지 않아??', '2020-12-24 (02:23)', 7, '', '', '', 1),
(34, 'MFDO', '메프도', '[유머] 머리가 세 개인 사람을 줄여 말하면 뭐게?', '헤드셋ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ\r\nㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ\r\nㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ\r\n\r\n재밌당', '2020-12-24 (02:25)', 8, '', '', '', 1);
