(43, 'MFDO', '메프도', '드디어 본래 기획했던 기능을 모두 구현했어요!', '<p style=\"text-align: center; \"><span style=\"font-size: 50px; color: rgb(255, 0, 0);\">기</span><span style=\"font-size: 36px; color: rgb(255, 156, 0);\">분</span><span style=\"color: rgb(255, 255, 0);\">이</span> <span style=\"font-size: 16px; color: rgb(0, 255, 0);\">너</span><span style=\"font-size: 18px; color: rgb(57, 123, 33);\">무</span> <span style=\"font-size: 24px; color: rgb(8, 82, 148);\">좋</span><span style=\"font-size: 28px; color: rgb(156, 0, 255);\">아</span><span style=\"font-size: 30px;\"><span style=\"font-size: 36px; color: rgb(115, 24, 66);\">요</span><span style=\"font-size: 50px; color: rgb(255, 0, 255);\">!</span></span><span style=\"font-size: 50px; color: rgb(198, 123, 165);\">!</span></p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"디코 배경용.jpg\" style=\"width: 50%;\"></p><b><div style=\"text-align: center;\"><b><span style=\"font-size: 24px;\">재밌어요!! 최고야 웹프!!</span></b></div></b><p></p>', '2020-12-24 (18:05)', 18, '', '', '', 1);
