(44, 'MFDO', '메프도', '[공지] 바른말 고운말 캠페인!', '<div style=\"line-height: 19px;\"><div style=\"\"><p class=\"0\" style=\"text-align: left;\"><b style=\"color: rgb(92, 206, 255);\"><span style=\"font-size: 20px;\">하이미키</span><span lang=\"EN-US\" style=\"font-family: \" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 20px;\"=\"\">!</span></b></p><p class=\"0\" style=\"text-align: left;\">미키마우섭 관리자 메프도입니다<span lang=\"EN-US\" style=\"font-family:맑은 고딕;mso-ascii-font-family:맑은 고딕;mso-font-width:100%;letter-spacing:0.0pt;mso-text-raise:0.0pt;\">!</span></p><p class=\"0\" style=\"text-align: left;\">미키마우섭에서는 다음의 규칙을 준수하도록 규정하고 있습니다<span lang=\"EN-US\" style=\"font-family:맑은 고딕;mso-ascii-font-family:맑은 고딕;mso-font-width:100%;letter-spacing:0.0pt;mso-text-raise:0.0pt;\">.</span></p><p class=\"0\" style=\"text-align: left;\"><span lang=\"EN-US\" style=\"font-family:맑은 고딕;mso-ascii-font-family:맑은 고딕;mso-font-width:100%;letter-spacing:0.0pt;mso-text-raise:0.0pt;\"><br></span></p><p class=\"0\" style=\"text-align: left;\">  <!--[if !supportEmptyParas]-->&nbsp;</p><p class=\"0\" style=\"text-align: left;\"><!--[endif]-->  <o:p></o:p></p><p class=\"0\" style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 0); color: rgb(66, 66, 66);\"><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">1. </span><span style=\"font-size: 18px;\">미키마우섭에서는 기본적으로 모든 메뉴에서 </span><b style=\"\"><span style=\"font-size: 18px;\">존댓말</span><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">(</span><span style=\"font-size: 18px;\">높임말</span><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">)</span><span style=\"font-size: 18px;\">을 사용</span></b><span style=\"font-size: 18px;\">합니다</span><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">.</span></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">예외적으로 반말이 가능한 곳 쪽지</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">, </span><span style=\"font-size: 16px;\">혼잣말에 사용 가능</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\">  </span><!--[if !supportEmptyParas]--><span style=\"font-size: 18px;\">&nbsp;</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\"><br></span><!--[endif]--><span style=\"font-size: 18px;\">  </span><o:p></o:p></p><p class=\"0\" style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 0); color: rgb(66, 66, 66);\"><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">2. </span><span style=\"font-size: 18px;\">미키마우섭에서는 기본적으로 모든 메뉴에서 회원 간 </span><b style=\"\"><span style=\"font-size: 18px;\">친목 행위가 금지</span></b><span style=\"font-size: 18px;\">되어 있습니다</span><span lang=\"EN-US\" style=\"font-size: 18px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">.</span></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">금지이유는 파벌형성</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">, </span><span style=\"font-size: 16px;\">신규회원의 소외감</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">, </span><span style=\"font-size: 16px;\">무의미한 친목과시형 글 남용</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">,</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">다른 회원에 대한 친목회원들의 일방적인 댓글 공격 등</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">친목 행위로 인한 부정적 사례가 매우 많습니다</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">.</span></p><p class=\"0\" style=\"text-align: left;\"><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\">  </span><!--[if !supportEmptyParas]--><span style=\"font-size: 18px;\">&nbsp;</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 18px;\"><br></span><!--[endif]--><span style=\"font-size: 18px;\">  </span><o:p></o:p></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">미키마우섭는 모든 회원들이 주인이며</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">모두가 힘을 모아 성장시킬 수 있는 참여형 커뮤니티입니다</span><span lang=\"EN-US\" style=\"font-size: 16px;\" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">.</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">  </span><!--[if !supportEmptyParas]--><span style=\"font-size: 16px;\">&nbsp;</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\"><br></span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\"><br></span><!--[endif]--><span style=\"font-size: 16px;\">  </span><o:p></o:p></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">운영진은 특정 집단에 치우침 없이</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">모든 회원들이 평등하고 자유롭게 활동 할 수 있는</span></p><p class=\"0\" style=\"text-align: left;\"><span style=\"font-size: 16px;\">최적의 커뮤니티 공간을 만들기 위해 친목행위에 대해 제한합니다</span><span lang=\"EN-US\" style=\"font-family: \" 맑은=\"\" 고딕\";=\"\" letter-spacing:=\"\" 0pt;=\"\" font-size:=\"\" 18px;\"=\"\">.</span></p></div></div>', '2020-12-25 (08:17)', 28, '', '', '', 1);
