(46, 'ChaCha', '차차', '이거 놔!!!', '&lt;p&gt;&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;b&gt;이거 노란 말이야!!!!!&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img style=&quot;width: 343px;&quot; src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;KakaoTalk_20201225_231321028.jpg&quot;&gt;&lt;br&gt;&lt;/p&gt;', '2020-12-25 (15:15)', 4, '', '', '', 1);
