(47, 'mingyu', '정민큐', '오늘은 내가 제일 좋아하는 발로란트를 해야겠어!', '&lt;p&gt;아~ 황부장이 하도 추천하길래 옛다 선심 수준으로 한 판 해주려 했는데?&lt;/p&gt;&lt;p&gt;이야 이거 마작보다 갓겜이더라고&lt;/p&gt;&lt;p&gt;하루만에 20판 다 하고 매칭 돌리니까 무려 브론즈2떴다.&lt;/p&gt;&lt;p&gt;휴가 나오면 종종 해야지&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; alt=&quot;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '2020-12-25 (15:18)', 4, '', '', '', 1);

